CREATE DATABASE IF NOT EXISTS bbs DEFAULT CHARACTER SET utf8 COLLATE utf8_unicode_ci;
use bbs;
DROP TABLE IF EXISTS board;
CREATE TABLE IF NOT EXISTS BBS (
	bbsID int,
	bbsTitle varchar(50),
	userID varchar(20),
	bbsDat DATETIME,
	bbsContent varchar(2048),
	bbsAvailable int,
	primary key (bbsID)
);



